  name: IisTraceListener
  nameWithType: IisTraceListener
  fullName: System.Web.IisTraceListener
  type: Class
  summary: "Fornece um serviço de escuta que encaminha todos os rastreio e depuração de saída para o [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] infraestrutura."
  remarks: "A classe de IisTraceListener liga o mecanismo de rastreio de [!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)] para [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)]. Esta classe de serviço de escuta permite aos programadores que criam [!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)] e aplicações que implementa o <xref:System.Web.IHttpModule>e <xref:System.Web.IHttpHandler>interfaces para elevar o nível de página, ao nível do módulo ou ao nível do processador de eventos para o [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] infraestrutura quando o rastreio está ativada.</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule>      > [!NOTE] > Esta classe de serviço de escuta não encaminhar [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] eventos para classes do ASP.NET. Isto inclui o <xref:System.Web.UI.Page>classe e classes que implementam o <xref:System.Web.IHttpModule>ou <xref:System.Web.IHttpHandler>interface.</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule> </xref:System.Web.UI.Page>       IisTraceListener é introduzida no [!INCLUDE[net_v35_long](~/add/includes/ajax-current-ext-md.md)]. Para obter mais informações, consulte [versões e dependências](~/add/includes/ajax-current-ext-md.md)."
